import React from 'react'
import ExpenseItem from './ExpenseItem'

const Expenses = (props) => {
  return (
    <div>
      <ExpenseItem
        date={props.date}
        title={props.title}
        amount={props.amount}
      />
      <ExpenseItem />
      <ExpenseItem />
    </div>
  )
}

export default Expenses
